import React, { useState } from 'react';
import {
  Box,
  TextField,
  Button,
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  IconButton,
  Paper,
  Typography,
  Grid,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { TimePicker } from '@mui/x-date-pickers/TimePicker';

function ActivityTracker() {
  const [activities, setActivities] = useState([]);
  const [newActivity, setNewActivity] = useState({
    description: '',
    startTime: null,
    endTime: null,
  });

  const handleAddActivity = (e) => {
    e.preventDefault();
    if (newActivity.description.trim() === '' || !newActivity.startTime || !newActivity.endTime) return;

    setActivities([...activities, {
      id: Date.now(),
      ...newActivity
    }]);

    setNewActivity({
      description: '',
      startTime: null,
      endTime: null,
    });
  };

  const handleDeleteActivity = (id) => {
    setActivities(activities.filter(activity => activity.id !== id));
  };

  const formatTime = (date) => {
    if (!date) return '';
    return date.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });
  };

  return (
    <Box sx={{ width: '100%', maxWidth: 800, mx: 'auto' }}>
      <Typography variant="h4" component="h1" gutterBottom>
        Daily Activity Tracker
      </Typography>

      <Paper sx={{ p: 2, mb: 2 }}>
        <form onSubmit={handleAddActivity}>
          <Grid container spacing={2} alignItems="center">
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth
                value={newActivity.description}
                onChange={(e) => setNewActivity({ ...newActivity, description: e.target.value })}
                placeholder="Activity description..."
                variant="outlined"
                size="small"
              />
            </Grid>
            <Grid item xs={12} sm={2}>
              <LocalizationProvider dateAdapter={AdapterDateFns}>
                <TimePicker
                  label="Start Time"
                  value={newActivity.startTime}
                  onChange={(newValue) => setNewActivity({ ...newActivity, startTime: newValue })}
                  renderInput={(params) => <TextField {...params} size="small" />}
                />
              </LocalizationProvider>
            </Grid>
            <Grid item xs={12} sm={2}>
              <LocalizationProvider dateAdapter={AdapterDateFns}>
                <TimePicker
                  label="End Time"
                  value={newActivity.endTime}
                  onChange={(newValue) => setNewActivity({ ...newActivity, endTime: newValue })}
                  renderInput={(params) => <TextField {...params} size="small" />}
                />
              </LocalizationProvider>
            </Grid>
            <Grid item xs={12} sm={2}>
              <Button
                type="submit"
                variant="contained"
                color="primary"
                fullWidth
              >
                Add
              </Button>
            </Grid>
          </Grid>
        </form>
      </Paper>

      <List>
        {activities.map((activity) => (
          <ListItem
            key={activity.id}
            sx={{
              bgcolor: 'background.paper',
              mb: 1,
              borderRadius: 1,
              border: '1px solid',
              borderColor: 'divider',
            }}
          >
            <ListItemText
              primary={activity.description}
              secondary={`${formatTime(activity.startTime)} - ${formatTime(activity.endTime)}`}
            />
            <ListItemSecondaryAction>
              <IconButton
                edge="end"
                onClick={() => handleDeleteActivity(activity.id)}
                color="error"
              >
                <DeleteIcon />
              </IconButton>
            </ListItemSecondaryAction>
          </ListItem>
        ))}
      </List>
    </Box>
  );
}

export default ActivityTracker;
